// Fonction pour parser une désignation
function parseDesignation(designation) {
  const result = { dci: null, dosage: null, forme: null, conditionnement: null, labo: null };
  let txt = (designation || '').toUpperCase().replace(/\s+/g, ' ').trim();

  // Dosage ex : 5MG, 10/160MG
  const dosage = txt.match(/\d+(\/\d+)?MG/);
  if (dosage) result.dosage = dosage[0];

  // Conditionnement ex : B/30, 30GE, 90CP, 30CP, 90GE
  const cond = txt.match(/(B\/\d+|\d+GE|\d+CP|\d+GÉ)/);
  if (cond) result.conditionnement = cond[0];

  // Forme galénique ex : GEL, GE, CPR, COMP, CP, PEL
  const forme = txt.match(/\b(GEL|GE|CPR|COMP|CP|PEL|GÉ)\b/);
  if (forme) result.forme = forme[0];

  // Laboratoire (génériques) ex : BIOG, BIOGARAN, BGN
  const labo = txt.match(/\b(BIOG|BIOGARAN|BGN)\b/);
  if (labo) result.labo = labo[0];

  // Extraire DCI en supprimant les autres blocs détectés
  ;[result.dosage, result.forme, result.conditionnement, result.labo].forEach(part => {
    if (part) txt = txt.replace(part, '');
  });
  result.dci = txt.trim();

  return result;
}

// Vérifier si deux formes sont équivalentes
function formesEquivalentes(f1, f2) {
  if (!f1 || !f2) return false;
  const eq = {
    'GEL': ['GE','GÉ','GÉLULE'],
    'GE': ['GEL','GÉ','GÉLULE'],
    'CPR': ['COMP','CP'],
    'COMP': ['CPR','CP'],
    'CP': ['CPR','COMP']
  };
  return (eq[f1] && eq[f1].includes(f2)) || (eq[f2] && eq[f2].includes(f1));
}

// Tester si deux données parsees sont équivalentes
function sontEquivalents(p1, p2) {
  return (
    p1.dci && p2.dci && p1.dci === p2.dci &&
    p1.dosage && p2.dosage && p1.dosage === p2.dosage &&
    (p1.forme === p2.forme || formesEquivalentes(p1.forme, p2.forme)) &&
    p1.conditionnement && p2.conditionnement && p1.conditionnement === p2.conditionnement
  );
}

// Lecture des items n8n
const datas = $('Merge Model REF - Data').map(i => ({
  original: i.json,
  parsed: parseDesignation(i.json.Designation)
}));

// Regroupement
const groupes = [];
datas.forEach(entry => {
  let g = groupes.find(g => sontEquivalents(g.parsed, entry.parsed));
  if (!g) {
    groupes.push({
      parsed: entry.parsed,
      items: [entry]
    });
  } else {
    g.items.push(entry);
  }
});

// Fusion et somme des stocks
const output = groupes.map(g => {
  const toutes = g.items;
  const reference = toutes[0].original.Designation;
  const totalStock = toutes.reduce((sum, e) => sum + (parseInt(e.original.Stock) || 0), 0);
  const codes = toutes.map(e => e.original['Code M']).filter(c => c).join(', ');
  return {
    json: {
      DesignationReference: reference,
      StockTotal: totalStock,
      NombreItems: toutes.length,
      Codes: codes,
      DCI: g.parsed.dci,
      Dosage: g.parsed.dosage,
      Forme: g.parsed.forme,
      Conditionnement: g.parsed.conditionnement,
      Labo: g.parsed.labo
    }
  };
});

return output;

// Ce script transforme un bloc de texte brut en un tableau JSON structuré

const rawText = $json["text"];

// Séparer le texte brut ligne par ligne
const lines = rawText.split('\n');

// Tableau final des produits
let produits = [];

let current = {
  code: '',
  designation: '',
  ventes: []
};

for (let i = 0; i < lines.length; i++) {
  const line = lines[i].trim();

  // Cherche un code produit (ex: ALFA017)
  const codeMatch = line.match(/^([A-Z]{4}\d{3,})$/);
  if (codeMatch) {
    // S'il y avait déjà un produit en cours, on le pousse
    if (current.code) {
      produits.push({ ...current });
    }

    // Nouveau produit
    current = {
      code: codeMatch[1],
      designation: '',
      ventes: []
    };

    // On suppose que la désignation est sur les 2 lignes suivantes
    current.designation = lines[i + 1].trim() + ' ' + lines[i + 2].trim();
    i += 2; // On saute les lignes de désignation
  } else if (/^\d+(\s+\-?\d+)+$/.test(line)) {
    // Si c’est une ligne de chiffres (stock + ventes)
    const chiffres = line.trim().split(/\s+/).map(x => parseInt(x));
    current.stock = chiffres[0];
    current.ventes = chiffres.slice(1);
  }
}

// Dernier produit à ajouter
if (current.code) {
  produits.push({ ...current });
}

// Renvoie le tableau JSON formaté
return produits.map(p => ({
  code: p.code,
  designation: p.designation,
  stock_30_04_2025: p.stock || 0,
  ventes_avril: p.ventes[0] || 0,
  ventes_mars: p.ventes[1] || 0,
  ventes_fevrier: p.ventes[2] || 0,
  ventes_janvier: p.ventes[3] || 0,
  ventes_decembre: p.ventes[4] || 0,
  ventes_novembre: p.ventes[5] || 0
}));

